#include <stdio.h>

int main() {
    char inputLetter, nextLetter;

    // Input a aphabetial letter
    printf("Enter letter: ");
    scanf(" %c", &inputLetter);  

    // Check if the input character is a lowercase letter
    if (inputLetter >= 'a' && inputLetter <= 'z') {
        // Calculate the next letter
        nextLetter = inputLetter + 1;

        // Display the input letter, arrow, and the next letter
        printf("%c -> %c\n", inputLetter, nextLetter);
    } else {
        printf("Invalid input. Please enter a lowercase letter.\n");
    }

    return 0;
}

