#include <stdio.h>

int main() {
    char inputLetter;

    printf("Enter letter: ");
    scanf(" %c", &inputLetter);


    // Calculate the next letter by wrapping around the alphabet
    char nextLetter = (inputLetter == 'z') ? 'a' : (inputLetter == 'Z') ? 'A' : inputLetter + 1;

    printf("\n%c -> %c\n", inputLetter, nextLetter);

    return 0;
}

