int main(void) 
{
    char input, next_letter;

    printf("Enter letter: ");
    scanf("%c", &input);

    if (input == 122 || input == 90) {
        next_letter = input - 25;
    }
    else {
        next_letter = input + 1;
    }

    printf("\n%c -> %c", input, next_letter);

    return 0;
}

