int main() {
    char inputLetter;
    
    printf("Enter letter: ");
    scanf(" %c", &inputLetter);  // Note the space before %c to consume any preceding whitespace
    
    char nextLetter;
    
    if (inputLetter >= 'a' && inputLetter < 'z') {
        nextLetter = inputLetter + 1;
    } else if (inputLetter >= 'A' && inputLetter < 'Z') {
        nextLetter = inputLetter + 1;
    } else {
        printf("Invalid input. Please enter a letter between 'a' and 'z' or 'A' and 'Z'.\n");
        return 1;  // Exit with an error code
    }
    
    printf("%c -> %c\n", inputLetter, nextLetter);
    
    return 0;
}

