    // Check if the input is an lowercase letter
    if (inputLetter >= 'a' && inputLetter < 'z') {
        char nextLetter = inputLetter + 1;
        printf("%c -> %c\n", inputLetter, nextLetter);
    }
    // Check if the input is a uppercase letter
    else if (inputLetter >= 'A' && inputLetter < 'Z') {
        char nextLetter = inputLetter + 1;
        printf("%c -> %c\n", inputLetter, nextLetter);
    }

    return 0;
}

