#include <stdio.h>

int main() {
    char inputLetter, nextLetter;

    printf("Enter a letter of the alphabet (not 'z' or 'Z'): ");
    scanf(" %c", &inputLetter); // Note the space before %c to consume any leading whitespace

    // Check if the input is 'y' or 'Y' and handle them as special cases
    if (inputLetter == 'y' || inputLetter == 'Y') {
        nextLetter = 'a';
    } else {
        // Increment the ASCII value of the input letter to get the next letter
        nextLetter = inputLetter + 1;
    }

    printf("%c -> %c\n", inputLetter, nextLetter);
    
    return 0;
}
In this program:

We use printf to prompt the user to enter a letter.
We use scanf with a space before %c to consume any leading whitespace or newline characters.
We check if the input letter is 'y' or 'Y' as a special case because the letter after 'y' and 'Y' is 'a'. For other letters, we increment the ASCII value of the input letter to get the next letter in the alphabet.
We use printf to display the original letter, an arrow (->), and the next letter.
Remember to test the program with various input letters to ensure it works as expected.

#include <stdio.h>

int main() {
    char inputLetter, nextLetter;

    printf("Enter a letter of the alphabet (not 'z' or 'Z'): ");
    scanf(" %c", &inputLetter); // Note the space before %c to consume any leading whitespace

    // Check if the input is 'y' or 'Y' and handle them as special cases
    if (inputLetter == 'y' || inputLetter == 'Y') {
        nextLetter = 'a';
    } else {
        // Increment the ASCII value of the input letter to get the next letter
        nextLetter = inputLetter + 1;
    }

    printf("%c -> %c\n", inputLetter, nextLetter);
    
    return 0;
}

