#include <stdio.h>

char nextLetter(char ch) {
    if (ch == 'z') return 'a';
    if (ch == 'Z') return 'A';
    if ((ch >= 'a' && ch < 'z') || (ch >= 'A' && ch < 'Z')) return ch + 1;
    return 0; // indicates invalid input
}

int main() {
    char letter, result;

    printf("Enter letter:\n");
    scanf("%c", &letter);

    result = nextLetter(letter);

    if (result) {
        printf("%c -> %c\n", letter, result);
    } else {
        printf("Please enter a valid letter of the alphabet.\n");
    }

    return 0;
}

